let univers;
var renS = "press any key"
renSize = 100


function preload(){

    univers = loadFont('UniversLTStd.otf');

}

function setup(){

    createCanvas(windowWidth, windowHeight, WEBGL)
    textFont(univers)
    textSize(renSize)

}

function keyPressed(){

  if (keyCode > 64 && keyCode < 91) {
    renS = key
    print(renS)
  }

}

function draw(){

    background(0)
    points = univers.textToPoints(renS, 0, 0, renSize, {
      sampleFactor: 1,
      simplifyThreshold: 0
    });

    bounds = univers.textBounds(renS, 0, 0, renSize);

    rotateY(frameCount * 0.008);
    //rotateY(mouseX * 0.01);

    translate(-width/2,-height/2,0); //moves our drawing origin to the top left corner
    fill(237, 34, 93);
    noStroke();
  count = 0
    for (p of points) {
      push()
      xP = width/2 + p.x
      yP = height/2 + p.y
      translate(xP,yP, sin(1000) * count/2 )
      box(5)
      pop()
      count++
    }

}
